import React from "react";
import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core';

import keepsake from './images/memories.png';

const App = () => {
    return (
       <Container maxWidth="lg">
        <AppBar position="static" color="inherit">
            <Typography variant="h2" align="center">Keepsake</Typography>
            <img src={keepsake} alt="keepsake" height="60" />
        </AppBar>
       </Container>
    )
}

export default App;
